import React from 'react'
import { Modal, Card, Divider } from "antd";
import { docs_catalog_1, docs_catalog_2, docs_catalog_3, docs_catalog_4 } from './docs.catalog';

export default function DocsDetails({ isModalOpen, handleOk, handleCancel, escalaDetails }) {
    const { cat1, cat2, cat3, cat4 } = escalaDetails;

    const CardWidget = ({ pregunta, respuesta }) => {
        return <Card>
            <Card.Grid>{pregunta}</Card.Grid>
            <Card.Grid><strong>{respuesta}</strong></Card.Grid>
        </Card>
    }

    return (
        <Modal title="Respuestas escala DOCS" open={isModalOpen} onOk={handleOk} onCancel={handleCancel} destroyOnClose>

            {
                docs_catalog_1.map((p, i) => {
                    // return <CardWidget pregunta={p.pregunta} respuesta={p.respuestas[cat1[i]]} />
                    return <div>
                        <span>{p.pregunta}</span>
                        <br />
                        <strong>{p.respuestas[cat1[i]]}</strong>
                    </div>
                })
            }

            <br />
            <Divider>Categoria 2</Divider>
            {
                docs_catalog_2.map((p, i) => {
                    return <Card>
                        <Card.Grid>{p.pregunta}</Card.Grid>
                        <Card.Grid><strong>{p.respuestas[cat2[i]]}</strong></Card.Grid>
                    </Card>
                })
            }

            <br />
            <Divider>Categoria 3</Divider>
            {
                docs_catalog_3.map((p, i) => {
                    return <div>
                        {p.pregunta}
                        <strong>{p.respuestas[cat3[i]]}</strong>
                    </div>
                })
            }

            <br />
            <Divider>Categoria 4</Divider>
            {
                docs_catalog_4.map((p, i) => {
                    return <div>
                        {p.pregunta}
                        <strong>{p.respuestas[cat4[i]]}</strong>
                    </div>
                })
            }
        </Modal>
    )
}
